#ERROR PAGE
#RESPONSIVE STYLE
*/


/*--------------------*/
/* BASIC TYPOGRAPHY */
/*--------------------*/

body,html{
  	overflow-x:hidden;  	
}

body {
	font-family: 'Open Sans', sans-serif;
	font-size: 16px;
	overflow-x: hidden !important;
	color: #838282;
}

ul{
	padding: 0;
	margin: 0;
	list-style: none;
}

a{ 
	text-decoration: none;
	color: #2f2f2f;  
}

a:focus{
	outline: none;
	text-decoration: none;
}

h1,h2,h3,h4,h5,h6{
	font-family: 'Cabin', sans-serif;
}

h2 {
	color: #fff;  
	font-size: 30px;
	font-weight: 700;
	line-height: 40px;
	margin: 0;
	padding-bottom: 10px;  
}

img{
 border:none;
}

/* Preloader */

#preloader {
  position: fixed;
  top:0;
  left:0;
  right:0;
  bottom:0;
  background-color:#fff; /* change if the mask should have another color then white */
  z-index:99999; /* makes sure it stays on top */ 
}

#status {
  width:200px;
  height:200px;
  position:absolute;
  left:50%; /* centers the loading animation horizontally one the screen */
  top:50%; /* centers the loading animation vertically one the screen */
  background-image:url(fileServer/IntegratorTest2/assets/images/loader.gif); /* path to your loading animation */
  background-repeat:no-repeat;
  background-position:center;
  margin:-100px 0 0 -100px; /* is width and height divided by two */
}

/*--------------------*/
/* HEADER */
/*--------------------*/

#header{
	float: left;
	display: inline;
	width: 100%;
}


.header-inner{	
	display: inline;
	position: relative;
	float: left;	
	width: 100%;
}


.overlay{
	background-color: rgba(0, 0, 0, 0.6);
	height: 100%;
	left: 0;
	position: absolute;
	top: 0;
	width: 100%;
	z-index: 10;
}


.header-content {
	float: left;
	width: 100%;
	height: 100%;
	text-align: center;
}


.header-top {
	display: inline;
	float: left;
	padding-top: 50px;
	width: 100%;
}


.logo-area{
	display: inline;
	float: left;
}


.logo {
  color: #fff;
  font-family: "Pacifico",cursive;
  font-size: 40px;
  font-weight: bold;
}


.logo:hover,
.logo:focus{
	text-decoration: none;
	outline: none;
	color: #fff;
}


.menu-area{
	display: inline;	
}


.main-wrap{
	position: relative;
}


.header-bottom {
	display: inline;
	float: left;
	margin-top: 70px;
	width: 100%;
}


.header-bottom-left {
	display: inline;
	float: left;
	padding-top: 60px;
	padding-right: 50px;
	text-align: left;
	width: 100%;
}


.header-bottom-left h1 {
	color: #fff;
	font-size: 40px;
	font-weight: bold;
	line-height: 60px;
	text-transform: uppercase;
}


.header-bottom-left p {
	color: #fff;
	font-size: 16px;
	margin: 35px 0 0;
}


.download-btn{
	border-radius: 3px;
	color: #ffffff;
	display: block;
	float: left;
	font-size: 16px;
	height: 48px;
	line-height: 48px;
	margin-top: 30px;
	opacity: 0.8;
	text-align: center;
	width: 180px;
	-webkit-transition: all 0.5s ease 0s;;
	-o-transition: all 0.5s ease 0s;;
	transition: all 0.5s ease 0s;;
}


.download-btn:hover,
.download-btn:focus{
	text-decoration: none;
	outline: none;
	color: #fff;
	opacity: 1;
}


.header-bottom-right{
	display: inline;
	float: left;
	width: 100%;
}


/*--------------------*/
/* MENU */
/*--------------------*/


#close {
	color: #fff;
	cursor: pointer;
	font-size: 15px;
	font-weight: bold;
	height: 20px;
	position: absolute;
	right: 25px;
	text-align: center;
	top: 20px;
	width: 20px;
}


#menu-btn {
  color: #5b7182;
  font-size: 30px;
  position: fixed;
  right: 75px;
  top: 50px;
  z-index: 99;
}


.main-nav {
	background-color: #1d252e;
	position: fixed;
	padding-top: 50px;
	width: 260px;
	height: 100%;
	top: 0;
	right: -260px;
	z-index: 1000;
}


.main-nav ul li a {
	color: #5b7182;
	display: block;
	font-size: 16px;
	font-weight: 300;
	padding: 10px 35px;
	text-decoration: none;
	-webkit-transition: all 0.5s;
	-o-transition: all 0.5s;
	transition: all 0.5s;
}


.main-nav ul li > a > i {
  	padding-right: 10px;
}


.main-nav a:hover,
.main-nav a:focus {
	background: #182029;
}


.main-nav a:active {
	background: #182029;	
}


.main-nav.menu-open {
	right: 0px;
}


.cbp-spmenu-push {
	overflow-x: hidden;
	position: relative;
	left: 0;
}


.main-nav,
.cbp-spmenu-push {
	-webkit-transition: all 0.3s ease;
	-moz-transition: all 0.3s ease;
	transition: all 0.3s ease;
}


/*--------------------*/
/* FEATURES */
/*--------------------*/


#features{
	background-color: #fff;
	display: inline;
	float: left;
	padding: 70px 0;
	width: 100%;
}


.title-area {
	display: inline;
	float: left;
	padding: 0 150px;  
	text-align: center;
	width: 100%;
}


.title-area .title {
	border-bottom: 2px solid #ccc;
	color: #777;
	display: inline-block;
	font-size: 33px;
	font-weight: 700;
	padding-bottom: 20px;
	position: relative;
	text-transform: uppercase;
}


.title-area .title::before {
	content: "";
	height: 2px;
	left: 0;
	position: absolute;
	top: 60px;
	width: 150px;
}


.title-area p{
	color: #777777;
	font-size: 18px;
	font-weight: 300;
	line-height: 1.8;
	padding: 20px 0 30px;
}


.features-area{
	display: inline;
	float: left;
	margin-top: 20px;
	width: 100%;
}


.features-left {
	display: inline;
	float: left;  
	width: 100%;
}


.features-list li {
	float: left;
	padding: 25px 0;
	position: relative;
}


.features-list li:hover .fa{
	color: #fff;
}


.features-list li i{
	background-color: #777;	
	border-radius: 50%;
	color: #fff;
	display: block;
	font-size: 35px;
	height: 90px;
	line-height: 93px;
	margin: 20px auto;
	position: absolute;
	text-align: center;
	top: 10px;
	transition: all 0.5s ease 0s;
	width: 90px;
}


.features-list-left li i {
  	left: 0;
}


.features-list-left .features-content{
	padding-left: 115px;
}


.features-content{
	float: left;
	display: inline;
	width: 100%;
}


.features-content h4 { 
	font-size: 18px;
	text-transform: uppercase;
}


.features-content p{
	font-size: 15px;	
}


.feature-img {
	display: inline;
	float: left;
	padding: 0 30px;
	text-align: center;
	width: 100%;
}


.feature-img img {
  	width: 100%;
}


.features-right{
	display: inline;
	float: left;	
	width: 100%;	
}


.features-list-right li i {
  	right: 0;
}


.features-list-right .features-content{
	padding-right: 115px;
}


/*--------------------*/
/* HOW IT WORKS */
/*--------------------*/


#howit-works {
	background-attachment: fixed !important;
	background-image: url("fileServer/IntegratorTest2/assets/images/howit-works-bg.jpg");
	background-repeat: repeat;  
	background-size: cover;  
	color: #ffffff;
	display: inline;
	float: left;
	padding: 70px 0;
	width: 100%;
}


.howit-works-area{
	display: inline;
	float: left;
	width: 100%;
}


.howit-works-area .title{
	color: #fff;
}


.howit-works-area .title-area p{
	color: #fff;
}


.howit-works-video{
	background: rgba(0, 0, 0, 0) url("fileServer/IntegratorTest2/assets/images/macbook-pro.png") no-repeat scroll center 100% / 100% auto;
	margin: 0 auto;
	max-width: 700px;
	padding: 70px 0 60px;
	position: relative;
	z-index: 10;
}


.howit-works-video iframe {
	border: medium none;
	margin-bottom: 20px;
	margin-left: 135px;
	width: 428px;
}


/*--------------------*/
/* PRICING TABLE */
/*--------------------*/


#pricing-table {
	display: inline;
	float: left;
	width: 100%;
	padding: 70px 0;
}


.pricing-table-content {
	display: inline;
	float: left;
	margin-top: 20px;
	width: 100%;
}


.single-plan {
	display: inline;
	float: left;
	width: 100%;
	background-color: #f0f0f0 ;
	-webkit-transition: all 0.5s;
	-o-transition: all 0.5s;
	transition: all 0.5s;
}


.single-plan:hover{  
  	box-shadow: 0 2px 20px #ccc;
}


.feature-price .single-plan-head p>span{
	color: #fff;
}


.single-plan-head {
	background-color: #424242;
	display: inline;
	float: left;
	padding: 10px 5px;
	text-align: center;
	width: 100%;
}


.single-plan-head h5 {
	color: #fff;
	font-size: 30px;
	font-weight: bold;
	margin-bottom: 0;
	padding: 5px;
	text-transform: uppercase;
}


.single-plan-head p {
	color: #fff;
	font-size: 25px;
	font-weight: bold;
	line-height: 30px;
}


.single-plan-head p > span {
	font-weight: normal;
	font-size: 15px;
}


.single-plan-content {
	display: inline;
	float: left;
	width: 100%;
	padding: 0 15px;
}


.single-plan-content ul{
	text-align: center;
}


.single-plan-content ul li {
	border-bottom: 1px solid #fff;
	padding: 15px 10px;
}


.single-plan-content ul li.delete{	
	text-decoration: line-through;
}


.single-plan-content ul li:last-child{
	border: none;
}


.single-plan-bottom {
	display: inline;
	float: left;
	padding: 15px 15px 30px;
	text-align: center;
	width: 100%;
}


.single-plan-bottom .signup-btn {
	border-radius: 3px;
	border: 1px none transparent;
	color: #fff;
	display: inline-block;
	font-size: 18px;
	opacity: 0.8;
	padding: 15px 50px;
	text-decoration: none;
	-webkit-transition: all 0.5s;
	-o-transition: all 0.5s;
	transition: all 0.5s;
}


.single-plan-bottom .signup-btn:hover{
	border-color: 1px solid #fff;
	opacity: 1;
}


/*--------------------*/
/* SCREENSHOT */
/*--------------------*/


#screenshot{
	background-color: #212121;
	display: inline;
	float: left;
	padding: 70px 0;
	width: 100%;
}


#screenshot .title,
#screenshot .title-area p{
	color: #fff;
}


.screenshots-area{
	display: inline;
	float: left;
	margin-top: 20px;
	width: 100%;
}


.screenshots-slide{
	display: inline;
	float: left;
	width: 100%;
}


.screenshots-slide li{
	outline: none;
}


.screenshots-slide li a {
	border: 5px solid #fff;
	display: block;
	float: left;  
	position: relative;
	-webkit-transition: all 0.5s;
	-o-transition: all 0.5s;
	transition: all 0.5s;
}


.view-btn-area {
	display: none;
	background-color: rgba(0, 0, 0, 0.8);
	height: 100%;
	left: 0; 
	position: absolute;
	text-align: center;
	top: 0;
	opacity: 0;
	width: 100%;
	-webkit-transition: all 0.5s;
	-o-transition: all 0.5s;
	transition: all 0.5s;
}


.view-btn {	
	color: #fff;
	font-size: 35px;  
	margin-top: 215px;	
}


.screenshots-slide li a:hover .view-btn-area{	
	display: block;
	opacity: 1;
}


.screenshots-slide .slick-dots li button {
  background-color: #fff;
  border: 0 none; 
  outline: none;
  height: 4px;  
  padding: 5px;
  width: 20px;
}


.screenshots-slide .slick-dots li button::before {
  display: none;
}


.screenshots-slide .slick-dots {
  bottom: -60px; 
}


/*--------------------*/
/* DOWNLOAD */
/*--------------------*/


#download-app {
  background-attachment: fixed !important;
  background-image: url("fileServer/IntegratorTest2/assets/images/download-bg.jpg");
  background-repeat: repeat;
  background-size: cover;
  color: #ffffff;
  display: inline;
  float: left;
  width: 100%;
}


.download-overlay {
  background: rgba(15, 22, 30, 0.8) none repeat scroll 0 0;
  color: #ffffff;
  display: inline;
  float: left;
  padding: 90px 0;
  width: 100%;
}


#download-app .title,
#download-app .title-area p{
	color: #fff;
}


.download-app-content{
	display: inline;
	float: left;
	width: 100%;
	text-align: center;
}


.single-download {
	border: 2px solid #fff;
	border-radius: 4px;
	display: inline-block;
	margin: 0 15px;
	padding: 18px 25px;
	width: 25%;
	-webkit-transition: all 0.5s;
	-o-transition: all 0.5s;
	transition: all 0.5s;
}


.download-icon{
	display: inline;
	float: left;
	width: 60px;
	color: #fff;
}


.download-icon i {
  font-size: 40px;
  margin-top: 5px;
}


.download-content {
  display: inline;
  float: left;
  text-align: left;
  margin-left: 5px;
}


.download-content p {
	color: #f8f8f8;
	font-size: 15px;
	margin-bottom: 3px;
}


.download-content span{
	color: #fff;
	font-size: 18px;
	font-weight: bold;

}


/*--------------------*/
/* TESTIMONIAL */
/*--------------------*/


#testimonial{
	background-color: #fff;
	display: inline;
	float: left;
	padding: 70px 0;
	width: 100%;
}


.testimonial-slider {
	background-color: #f7f7f7;
	display: inline;
	float: left;
	padding: 40px;
	width: 100%;
	border: 1px solid #ddd;
}


.testimonial-single-slide {
	display: inline;
	float: left;
	padding: 75px 50px 20px;
	text-align: center;
	width: 100%;
}


.testi-avatar {
	background: #fff none repeat scroll 0 0;
	border: 2px solid #ddd;
	border-radius: 50%;
	height: 90px;
	display: inline-block !important;
	margin-top: -80px;
	padding: 2px;
	width: 90px;
}


.testi-name {
	color: #404244;
	font-size: 18px;
	letter-spacing: 1px;
	margin: 10px 0 0;
	text-align: center;
	text-transform: uppercase;
}


.testi-company{
	font-size: 14px;
	text-align: center;
}


.testi-text {
	color: #8d959d;
	display: inline-block;
	font-size: 20px;
	font-style: italic;
	font-weight: 700;
	line-height: 25px;
	margin: 0 auto;
	position: relative;
	text-align: center;
}


.testi-text:before{
	content: '\f10d';
	position: absolute;
	font-family: fontAwesome;
	left: -10px;
	top: -20px;
}


.testimonial-slider .slick-dots {
	bottom: 15px;
	margin-left: -40px;
}


.testimonial-slider .slick-dots li {
	background: #ccc none repeat scroll 0 0;
	border-radius: 50%;
	color: #fff;
	cursor: pointer;
	display: inline-block;
	height: 20px;
	margin: 0 5px;
	padding: 0;
	position: relative;
	width: 20px;
}


.testimonial-slider .slick-dots li.slick-active {
  	opacity: 1;
}


.testimonial-slider .slick-dots li button::before{
	display: none;
}


/*--------------------*/
/* SUBSCRIBE */
/*--------------------*/


#subscribe{
	background-attachment: fixed !important;
	background-image: url("fileServer/IntegratorTest2/assets/images/subscribe-bg.jpg");
	background-repeat: repeat;
	background-size: cover;
	color: #ffffff;
	display: inline;
	float: left;
	width: 100%;
}


#subscribe .title,
#subscribe .title-area p{
	color: #fff;
}


#subscribe .title-area .title::before {  
  	width: 250px;
}


.subscribe-content{
	display: inline;
	float: left;
	width: 100%;
}


.subcr-form {
	margin: 0 auto;
	position: relative;
	width: 800px;
}


.subcr-form i {
	font-size: 30px;
	left: 20px;
	position: absolute;
	top: 17px;
}


.subcr-form input[type="text"] {
	color: #555;
	float: left;
	font-size: 18px;
	height: 65px;
	padding-left: 60px;
	padding-right: 155px;
	width: 100%;
}


.subcr-form .subcr-btn {
	border: medium none;
	font-size: 20px;
	font-weight: bold;
	height: 65px;
	opacity: 0.8;
	padding: 10px;
	position: absolute;
	right: 0;
	text-transform: uppercase;
	width: 150px;
	-webkit-transition: all 0.5s;
	-o-transition: all 0.5s;
	transition: all 0.5s;
}


.subcr-form .subcr-btn:hover,
.subcr-form .subcr-btn:focus{
	opacity: 1;
}


/*--------------------*/
/* CONTACT */
/*--------------------*/


#contact{
	background-color: rgba(15, 22, 30, 0.8);
	background-image: url(fileServer/IntegratorTest2/assets/images/contact-bg.png);
	background-repeat: no-repeat;
	display: inline;
	float: left;
	width: 100%;
	padding: 90px 0;
}


#contact .title,
#contact .title-area p{
	color: #fff;
}


.contact-area {
	display: inline;
	float: left;
	margin-top: 20px;
	padding: 0 150px;
	width: 100%;
}


.contact-form{}
.contact-form input{
	height: 45px;
	border-radius: 0;
}


.contact-form textarea {
	border-radius: 0;
	height: 250px;
	padding: 15px;
}


.contact-form .form-control {
	background-color: rgba(15, 22, 30, 0.8);  
	color: #ffffff;
	font-size: 16px;
	box-shadow: none;
}


.contact-form.form-control::-webkit-input-placeholder {
	color: #ffffff;
	font-size: 16px;
}


.contact-form .form-control:-moz-placeholder { /* Firefox 18- */
	color: #ffffff;
	font-size: 16px;
}


.contact-form .form-control::-moz-placeholder {  /* Firefox 19+ */
	color: #ffffff;
	font-size: 16px;
}


.contact-form .form-control:-ms-input-placeholder {  
    color: #ffffff;
   	font-size: 16px;
}


.send-area{
	display: inline;
	float: left;
	text-align: center;
	margin-top: 15px;
	width: 100%;
}


.send-btn {
	background-color: transparent;
	border: 1px solid #ccc;
	color: #fff;
	display: inline-block;
	height: 50px;
	margin: 0 auto;
	padding: 10px;
	width: 150px;
	-webkit-transition: all 0.5s;
	-o-transition: all 0.5s;
	transition: all 0.5s;
}


/*--------------------*/
/* FOOTER */
/*--------------------*/


#footer {
	background-color: #1d252e;
	display: inline;
	float: left;
	padding: 40px 0;
	width: 100%;
}


.footer-social{
	display: inline;
	float: left;
	width: 100%;
	text-align: center;
}


.footer-social a{
	display: inline-block;
	color: #fff;
	font-size: 18px;
	margin: 5px;
}


.footer-text{
	display: inline;
	float: left;
	padding: 10px 0;
	width: 100%;
	text-align: center;
}


.footer-text p{
	margin-bottom: 0;
}


.footer-text p a{
	color: #838282;
	text-decoration: none;
}


/*--------------------*/
/* ERROR PAGE */
/*--------------------*/


#error{
	display: inline;
